	workInfo = async (id) => { return await this.get(`/creation-tools/v1/works/${id}`); };
	easyWorkInfo = async (id, key) => {
		let abilities = ['is_collected', 'is_owned', 'is_praised'];/*收藏、再创作、点赞*/
		let user_info = ['author_id', 'nickname'];/*id、用户名*/
